import React, { useState } from 'react';

function VehicleForm() {
    const [formData, setFormData] = useState({
        brand: '',
        model: '',
        year: '',
        color: '',
        plate: ''
    });

    const [emptyFields, setEmptyFields] = useState([]);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        const emptyFieldsArray = Object.keys(formData).filter(key => formData[key] === '');
        if (emptyFieldsArray.length > 0) {
            setEmptyFields(emptyFieldsArray);
        } else {
            setEmptyFields([]);
            // Aquí puedes hacer lo que quieras con los datos del formulario
            console.log('Datos del formulario:', formData);
            // Por ejemplo, puedes enviarlos a un servidor o almacenarlos localmente
        }
    };

    return (
        <div>
            <h2 style={{ textAlign: 'center' }}>Alta de Vehículo</h2>
            <div style={{ margin: '7%' }}>
                <form
                    onSubmit={handleSubmit}
                    style={{
                        display: "grid",
                        gridTemplateColumns: "repeat(auto-fill, minmax(300px, 1fr))",
                        gap: "1rem",
                    }}
                >
                    <div style={{ display: "grid", gridTemplateRows: "auto 1fr", gap: "0.5rem" }}>
                        <label htmlFor="brand">Marca{emptyFields.includes('brand') && " *"}:</label>
                        <input
                            type="text"
                            id="brand"
                            name="brand"
                            value={formData.brand}
                            onChange={handleChange}
                            required
                            style={{height: '25px'}}
                        />
                    </div>
                    <div style={{ display: "grid", gridTemplateRows: "auto 1fr", gap: "0.5rem" }}>
                        <label htmlFor="model">Modelo{emptyFields.includes('model') && " *"}:</label>
                        <input
                            type="text"
                            id="model"
                            name="model"
                            value={formData.model}
                            onChange={handleChange}
                            required
                            style={{height: '25px'}}
                        />
                    </div>
                    <div style={{ display: "grid", gridTemplateRows: "auto 1fr", gap: "0.5rem" }}>
                        <label htmlFor="year">Año{emptyFields.includes('year') && " *"}:</label>
                        <input
                            type="number"
                            id="year"
                            name="year"
                            value={formData.year}
                            onChange={handleChange}
                            min="1900"
                            max="2099"
                            required
                            style={{height: '25px'}}
                        />
                    </div>
                    <div style={{ display: "grid", gridTemplateRows: "auto 1fr", gap: "0.5rem" }}>
                        <label htmlFor="color">Color{emptyFields.includes('color') && " *"}:</label>
                        <input
                            type="text"
                            id="color"
                            name="color"
                            value={formData.color}
                            onChange={handleChange}
                            required
                            style={{height: '25px'}}
                        />
                    </div>
                    <div style={{ display: "grid", gridTemplateRows: "auto 1fr", gap: "0.5rem" }}>
                        <label htmlFor="plate">Matrícula{emptyFields.includes('plate') && " *"}:</label>
                        <input
                            type="text"
                            id="plate"
                            name="plate"
                            value={formData.plate}
                            onChange={handleChange}
                            required
                            style={{ width: "100%" ,height: '25px'}}
                        />
                    </div>
                </form>
                <button type="submit" style={{ color: 'white', textDecoration: 'none', padding: '10px 20px', borderRadius: '5px', backgroundColor: '#007bff', marginRight: '10px',border: 'aliceblue',marginTop: '10px',width: '10%' }}>Enviar</button>
            </div>


        </div>
    );
}

export default VehicleForm;
